import React from 'react';
import './styles/index.css';

const App = () => {
  return (
    <div className="p-4 text-center">
      <h1 className="text-3xl font-bold">Sentence Builder Game</h1>
      <p className="mt-2 text-gray-600">Let's build some sentences!</p>
    </div>
  );
};

export default App;
